CREATE TABLE time_series_data (
    timestamp TIMESTAMPTZ,
    value FLOAT,
    device_id INT
);

CREATE TABLE rolling_average (
    timestamp TIMESTAMPTZ,
    device_id INT,
    avg_value FLOAT
);

CREATE TABLE rank_data (
    timestamp TIMESTAMPTZ,
    device_id INT,
    value FLOAT,
    rank INT
