CREATE TABLE time_series_data (
    timestamp TIMESTAMP,
    value DECIMAL,
    category VARCHAR,
    PRIMARY KEY (timestamp)
);

CREATE TABLE monthly_summary (
    month DATE,
    total_value DECIMAL,
    total_count INT,
    PRIMARY KEY (month)
);

CREATE TABLE rolling_average (
    timestamp TIMESTAMP,
    avg_value DECIMAL,
